	(123,43,'wpcf-cau-hoi','Tôi có thể đặt một thiết bị điện phía dưới máy lạnh được không?'),
	(124,43,'wpcf-tra-loi','<strong>Không nên làm như vậy do:</strong>\r\n<ul>\r\n 	<li>Hơi ẩm trong không khí có thể ngưng tụ ở dàn lạnh và nhỏ xuống thiết bị điện phía dưới.</li>\r\n 	<li>Hiện tượng ngưng tụ có thể xảy ra ở các điểm nối ống tại dàn ngoài trong quá trình làm mát.</li>\r\n</ul>'),
	(125,43,'wpcf-ngay-tao',''),
	(132,41,'wpcf-cau-hoi','Điều gì sẽ xảy ra nếu tôi không tiến hành bảo dưỡng máy?'),
	(133,41,'wpcf-tra-loi','Tuổi thọ của máy lạnh sẽ bị rút ngắn, lõi làm mát và rôto sẽ bị tắc và có thể xảy ra hiện tượng rò nước. Kết quả là làm giảm hiệu suất hoạt động và làm mát của máy lạnh.'),
	(134,41,'wpcf-hinh-dai-dien','http://demo-wordpress.dev/wp-content/uploads/2017/04/1wallpapers-of-nature-1080x810.jpg'),
	(135,41,'wpcf-ngay-tao','1492560000'),
	(140,42,'wpcf-cau-hoi','Tôi có thể đặt lọ hoa lên trên dàn nóng được không?'),
	(141,42,'wpcf-tra-loi','Không. Không được đặt bất cứ vật gì lên trên dàn nóng vì điều này có thể gây khó khăn cho nhân viên bảo dưỡng hay cũng có thể gây nguy hiểm cho những người dân sống xung quanh.'),
	(142,42,'wpcf-hinh-dai-dien','http://demo-wordpress.dev/wp-content/uploads/2017/04/1little-gril-listening-to-music-headphones-12401885.jpg'),
	(143,42,'wpcf-ngay-tao',''),
	(144,44,'wpcf-cau-hoi','Nếu phòng của tôi bị mặt trời chiếu sáng trực tiếp thì có ảnh hưởng gì đến việc lựa chọn máy lạnh  không?'),
	(145,44,'wpcf-tra-loi','Có. Công suất làm mát sẽ bị ảnh hưởng. Tuy nhiên, bạn có thể chọn cách lắp đặt một hệ thống máy lạnh có công suất lớn hơn cho phòng đó. Hãy tham khảo ý kiến nhân viên lắp máy để chọn công suất làm mát thích hợp.\r\n\r\nĐiều gì xảy ra nếu đèn báo tín hiệu lọc phát sáng? Chức năng của đèn này là gì? (Chỉ áp dụng cho một số máy có đèn báo)\r\n\r\nĐiều này cho biết phin lọc khí cần được vệ sinh. Đèn này cảnh báo đã đến thời gian vệ sinh bộ lọc, tùy thuộc vào môi trường sử dụng. Đèn có tác dụng nhắc nhở người sử dụng vệ sinh lọc khí. Sau khi vệ sinh, cần phải thiết lập lại đèn báo bằng cách nhấn nút tín hiệu bộ lọc trên điều khiển từ xa để tắt đèn báo đỏ.\r\n\r\n(Sưu tầm)'),
