	(23,1,'2017-04-18 06:48:49','2017-04-18 06:48:49','<div><em><strong>Tổ quốc tôi như một con tàu</strong></em></div>\r\n<em><strong>Mũi thuyền ta đó Mũi Cà Mau</strong></em>\r\n\r\n- Câu thơ rất hay của nhà thơ Xuân Diệu mà nhiều người từng đọc đã gợi tả sinh động vùng đất cực Nam của Tổ quốc.\r\n\r\n- Mũi Cà Mau hướng về phía tây, thuộc địa phận xóm Mũi, xã Đất Mũi, huyện Ngọc Hiển, tỉnh Cà Mau, cách thành phố Cà Mau hơn 100 km. Bên trái Mũi giáp biển Đông dài 104 km, bên phải giáp biển Tây, tức Vịnh Thái Lan dài 145 km.\r\n\r\n–&gt; Mũi Cà Mau cũng là nơi duy nhất trên đất liền Việt Nam có thể thấy mặt trời mọc ở biển Đông và lặn ở biển Tây.\r\n\r\n- Người Việt khi nói về đất nước của mình thường dùng câu “Nước Việt Nam trải dài từ Ải Nam Quan đến Mũi Cà Mau“. Vì vậy, trong tâm thức người Việt, cùng với Ải Nam Quan, Mũi Cà Mau là một địa điểm thiêng liêng, xa xôi nhưng rất đỗi gần gũi.\r\n\r\nKính thưa quý khách hàng !\r\n\r\n- Bán đảo Cà Mau, nơi có mặt giáp biển, nơi giao thoa giữa hai dòng hải lưu Đông – Tây đọng lại phù sa lấn dần ra biển. \"Cà Mau, đêm trở mình nghe đất nở\" nơi có bãi bồi rộng hàng ngàn hecta, là cái rốn hải sản. Cà Mau, nơi có mạng lưới sông ngòi, kênh rạch chằng chịt, bạt ngàn rừng đước, rừng tràm với 3 hệ sinh thái mặn – ngọt – lợ.\r\n\r\n- Là người Việt Nam, ai chẳng muốn được một lần xuôi về Đất Mũi Cà Mau, nơi chót cùng bản đồ hình chữ S để cảm nhận hết sự kỳ vĩ của bạt ngàn rừng đước, rừng tràm, sự diệu kỳ của hạt phù sa lấn biển,. Được chiêm ngưỡng, khám phá sự đa dạng sinh học của các hệ sinh thái rừng ngập mặn, hệ sinh thái trên đất than bùn, hệ sinh thái biển……\r\n\r\n- Chính sự kết hợp hài hòa giữa rừng và biển, sự đan xen giữa hệ sinh thái mặn, ngọt và lợ, tạo cho vùng bán đảo Cà Mau một hệ sinh thái đa dạng, phong phú, nơi được xem là xứ sở của những đặc sản mà khó nơi nào có được. Đó là mật ong rừng U Minh, Ba Khía Rạch Gốc, Mắm lóc U Minh; Sò huyết Bãi Bồi; Tôm khô Bãi Háp, Hàu Đá Bạc, khô cá khoai Cái Đôi Vàm, Cua Biển Năm Căn….','Giới thiệu','','publish','closed','closed','','gioi-thieu','','','2017-04-18 06:48:49','2017-04-18 06:48:49','',0,'http://demo-wordpress.dev/?page_id=23',0,'page','',0),
	(24,1,'2017-04-18 06:48:49','2017-04-18 06:48:49','<div><em><strong>Tổ quốc tôi như một con tàu</strong></em></div>\r\n<em><strong>Mũi thuyền ta đó Mũi Cà Mau</strong></em>\r\n\r\n- Câu thơ rất hay của nhà thơ Xuân Diệu mà nhiều người từng đọc đã gợi tả sinh động vùng đất cực Nam của Tổ quốc.\r\n\r\n- Mũi Cà Mau hướng về phía tây, thuộc địa phận xóm Mũi, xã Đất Mũi, huyện Ngọc Hiển, tỉnh Cà Mau, cách thành phố Cà Mau hơn 100 km. Bên trái Mũi giáp biển Đông dài 104 km, bên phải giáp biển Tây, tức Vịnh Thái Lan dài 145 km.\r\n\r\n–&gt; Mũi Cà Mau cũng là nơi duy nhất trên đất liền Việt Nam có thể thấy mặt trời mọc ở biển Đông và lặn ở biển Tây.\r\n\r\n- Người Việt khi nói về đất nước của mình thường dùng câu “Nước Việt Nam trải dài từ Ải Nam Quan đến Mũi Cà Mau“. Vì vậy, trong tâm thức người Việt, cùng với Ải Nam Quan, Mũi Cà Mau là một địa điểm thiêng liêng, xa xôi nhưng rất đỗi gần gũi.\r\n\r\nKính thưa quý khách hàng !\r\n\r\n- Bán đảo Cà Mau, nơi có mặt giáp biển, nơi giao thoa giữa hai dòng hải lưu Đông – Tây đọng lại phù sa lấn dần ra biển. \"Cà Mau, đêm trở mình nghe đất nở\" nơi có bãi bồi rộng hàng ngàn hecta, là cái rốn hải sản. Cà Mau, nơi có mạng lưới sông ngòi, kênh rạch chằng chịt, bạt ngàn rừng đước, rừng tràm với 3 hệ sinh thái mặn – ngọt – lợ.\r\n\r\n- Là người Việt Nam, ai chẳng muốn được một lần xuôi về Đất Mũi Cà Mau, nơi chót cùng bản đồ hình chữ S để cảm nhận hết sự kỳ vĩ của bạt ngàn rừng đước, rừng tràm, sự diệu kỳ của hạt phù sa lấn biển,. Được chiêm ngưỡng, khám phá sự đa dạng sinh học của các hệ sinh thái rừng ngập mặn, hệ sinh thái trên đất than bùn, hệ sinh thái biển……\r\n\r\n- Chính sự kết hợp hài hòa giữa rừng và biển, sự đan xen giữa hệ sinh thái mặn, ngọt và lợ, tạo cho vùng bán đảo Cà Mau một hệ sinh thái đa dạng, phong phú, nơi được xem là xứ sở của những đặc sản mà khó nơi nào có được. Đó là mật ong rừng U Minh, Ba Khía Rạch Gốc, Mắm lóc U Minh; Sò huyết Bãi Bồi; Tôm khô Bãi Háp, Hàu Đá Bạc, khô cá khoai Cái Đôi Vàm, Cua Biển Năm Căn….','Giới thiệu','','inherit','closed','closed','','23-revision-v1','','','2017-04-18 06:48:49','2017-04-18 06:48:49','',23,'http://demo-wordpress.dev/index.php/2017/04/18/23-revision-v1/',0,'revision','',0),
	(25,1,'2017-04-18 06:49:25','2017-04-18 06:49:25','Kính thưa quý khách hàng !\r\n\r\n- Hiện nay có nhiều nơi lấy danh nghĩa bán Đặc Sản Cà Mau nhưng thực ra hàng hóa mà họ bán là những sản phẩm nhái thương hiệu các món đặc sản ngon của Cà Mau.\r\n\r\n- Chúng tôi là những người con Cà Mau, mong muốn giới thiệu đến quý khách hàng gần xa những món đặc sản ngon của quê hương Cà Mau. Chúng tôi luôn phấn đấu khẳng định sự tin tưởng về Uy Tín &amp; Chất Lượng khi quý khách mua sắm tại hệ thống Đặc Sản Cà Mau của chúng tôi. Đến với chúng tôi quý khách hàng sẽ hài lòng khi được mua sắm những món <a href=\"http://www.dacsancamau.com/\">Đặc Sản Cà Mau</a> chính hiệu.\r\n\r\n- Cà Mau là vùng đất tận cùng của đất nước đã đóng góp nhiều món ăn ngon cho nền ẩm thực Việt Nam.','Liên Hệ','','publish','closed','closed','','lien-he','','','2017-04-18 06:49:25','2017-04-18 06:49:25','',0,'http://demo-wordpress.dev/?page_id=25',0,'page','',0),
	(26,1,'2017-04-18 06:49:25','2017-04-18 06:49:25','Kính thưa quý khách hàng !\r\n\r\n- Hiện nay có nhiều nơi lấy danh nghĩa bán Đặc Sản Cà Mau nhưng thực ra hàng hóa mà họ bán là những sản phẩm nhái thương hiệu các món đặc sản ngon của Cà Mau.\r\n\r\n- Chúng tôi là những người con Cà Mau, mong muốn giới thiệu đến quý khách hàng gần xa những món đặc sản ngon của quê hương Cà Mau. Chúng tôi luôn phấn đấu khẳng định sự tin tưởng về Uy Tín &amp; Chất Lượng khi quý khách mua sắm tại hệ thống Đặc Sản Cà Mau của chúng tôi. Đến với chúng tôi quý khách hàng sẽ hài lòng khi được mua sắm những món <a href=\"http://www.dacsancamau.com/\">Đặc Sản Cà Mau</a> chính hiệu.\r\n\r\n- Cà Mau là vùng đất tận cùng của đất nước đã đóng góp nhiều món ăn ngon cho nền ẩm thực Việt Nam.','Liên Hệ','','inherit','closed','closed','','25-revision-v1','','','2017-04-18 06:49:25','2017-04-18 06:49:25','',25,'http://demo-wordpress.dev/index.php/2017/04/18/25-revision-v1/',0,'revision','',0),
	(27,1,'2017-04-18 06:55:01','2017-04-18 06:55:01','<div class=\"cuisine-detail-des\">\r\n<h2>Nói đến món ngon, đặc sản của Cà Mau thì phải nói đến con cua, cua Cà Mau ngon, ngọt, chắc thịt nổi tiếng khắp nước mà những con cua nơi khác không thể sánh bằng!</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nCà Mau được thiên nhiên ưu đãi với ba mặt tiếp giáp biển cùng với hệ sinh thái rừng ngập mặn phát triển nên nguồn thủy hải sản vô cùng đa dạng và phong phú và cũng là môi trường lý tưởng, thuận lơi cho con cua phát triển.\r\n\r\nNgày trước, cua biển ở Cà Mau nhiều vô số kể, nhưng hiện nay, cua trong thiên nhiên còn rất ít, phần lớn cua được nuôi kết hợp trong những ao đầm nuôi tôm. Tuy vậy, nguồn thức ăn cho cua vẫn là từ tự nhiên, cua vận động nhiều nên thịt vẫn ngọt và săn chắc.\r\n\r\n</div>','Cua Cà Mau - Đặc sản nổi tiếng khắp nước','','publish','open','open','','cua-ca-mau-dac-san-noi-tieng-khap-nuoc','','','2017-04-18 06:55:01','2017-04-18 06:55:01','',0,'http://demo-wordpress.dev/?p=27',0,'post','',0),
	(28,1,'2017-04-18 06:55:01','2017-04-18 06:55:01','<div class=\"cuisine-detail-des\">\r\n<h2>Nói đến món ngon, đặc sản của Cà Mau thì phải nói đến con cua, cua Cà Mau ngon, ngọt, chắc thịt nổi tiếng khắp nước mà những con cua nơi khác không thể sánh bằng!</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nCà Mau được thiên nhiên ưu đãi với ba mặt tiếp giáp biển cùng với hệ sinh thái rừng ngập mặn phát triển nên nguồn thủy hải sản vô cùng đa dạng và phong phú và cũng là môi trường lý tưởng, thuận lơi cho con cua phát triển.\r\n\r\nNgày trước, cua biển ở Cà Mau nhiều vô số kể, nhưng hiện nay, cua trong thiên nhiên còn rất ít, phần lớn cua được nuôi kết hợp trong những ao đầm nuôi tôm. Tuy vậy, nguồn thức ăn cho cua vẫn là từ tự nhiên, cua vận động nhiều nên thịt vẫn ngọt và săn chắc.\r\n\r\n</div>','Cua Cà Mau - Đặc sản nổi tiếng khắp nước','','inherit','closed','closed','','27-revision-v1','','','2017-04-18 06:55:01','2017-04-18 06:55:01','',27,'http://demo-wordpress.dev/index.php/2017/04/18/27-revision-v1/',0,'revision','',0),
	(29,1,'2017-04-18 06:55:47','2017-04-18 06:55:47','<div class=\"cuisine-detail-des\">\r\n<h2>Mắm tép, từ lâu đã trở thành món ăn quen thuộc và phổ biến của người Cà Mau, nhất là vào dịp Tết Nguyên Đán, dù giàu hay nghèo, nhà nào cũng sắm một keo mắm tép để ăn Tết!</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nKhông giống như những loại mắm làm từ con tôm (tép) như mắm tôm ở Bắc, mắm ruốc ở Huế, mắm tôm chà ở Gò Công, mắm tép Cà Màu sau khi thành phẩm vẫn giữ được hình dáng của con tép, màu mắm đỏ au, nhìn rất hấp dẫn, chỉ muốn thưởng thức ngay.\r\n\r\nĐể có một keo mắm tép thơm ngon, người Cà Mau chọn những con tép đất còn tươi sống, không quá lớn mà cũng không quá nhỏ để làm mắm.\r\n\r\nTép đất đem về rửa nước muối cho sạch, lặt bỏ phần đầu, rút chỉ (phân tôm) để ráo rồi rửa lại bằng rượu trắng, ướp qua một ít mật ong rồi sắp vào keo. Tiếp đến nấu nước mắm đường cho vào keo cùng với một ít tỏi ớt xắt mỏng rồi đem phơi nắng, phơi đến khi con tép chuyển qua màu đỏ au, bắt mắt là có thể dùng được.\r\n\r\n</div>','Mắm tép Cà Mau - Đỏ au tình nắng biển hương rừng','','publish','open','open','','mam-tep-ca-mau-do-au-tinh-nang-bien-huong-rung','','','2017-04-18 08:12:56','2017-04-18 08:12:56','',0,'http://demo-wordpress.dev/?p=29',0,'post','',0),
