	(31,1,'2017-04-18 06:56:24','2017-04-18 06:56:24','<div class=\"cuisine-detail-des\">\r\n<h2>Người Nam Bộ có câu: “Nhất nướng, nhì chiên, tam xào, tứ luộc”, món nướng được đưa lên đứng đầu là bởi sự đa dạng phong phú của nó và cũng là món vẫn giữ được chất ngọt và hương vị nguyên sơ của lương thực, thực phẩm.</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nTrong thực đơn ẩm thực, ta có thể dễ dàng kể ra hàng chục, thậm chí hàng trăm món nướng. Từ con gà, con cá, con tôm, con cua đến củ khoai, trái bắp khi nướng lên đều có mùi thơm hấp dẫn, khó có thể cưỡng lại được.\r\n\r\nRiêng ở Cà Mau, mảnh đất tận cùng của tổ quốc, có một món ngon đậm chất dân dã, gắn liền từ thời cha ông đi khai hoang mở cõi cho đến tận bây giờ, đó là món cá lóc nướng trui.\r\n\r\n</div>','Cá lóc nướng trui - Món ngon thời khẩn hoang','','publish','open','open','','ca-loc-nuong-trui-mon-ngon-thoi-khan-hoang','','','2017-04-18 08:44:09','2017-04-18 08:44:09','',0,'http://demo-wordpress.dev/?p=31',0,'post','',0),
	(32,1,'2017-04-18 06:56:24','2017-04-18 06:56:24','<div class=\"cuisine-detail-des\">\r\n<h2>Người Nam Bộ có câu: “Nhất nướng, nhì chiên, tam xào, tứ luộc”, món nướng được đưa lên đứng đầu là bởi sự đa dạng phong phú của nó và cũng là món vẫn giữ được chất ngọt và hương vị nguyên sơ của lương thực, thực phẩm.</h2>\r\n</div>\r\n<div></div>\r\n<div class=\"cuisine-detail-content\">\r\n\r\nTrong thực đơn ẩm thực, ta có thể dễ dàng kể ra hàng chục, thậm chí hàng trăm món nướng. Từ con gà, con cá, con tôm, con cua đến củ khoai, trái bắp khi nướng lên đều có mùi thơm hấp dẫn, khó có thể cưỡng lại được.\r\n\r\nRiêng ở Cà Mau, mảnh đất tận cùng của tổ quốc, có một món ngon đậm chất dân dã, gắn liền từ thời cha ông đi khai hoang mở cõi cho đến tận bây giờ, đó là món cá lóc nướng trui.\r\n\r\n</div>','Cá lóc nướng trui - Món ngon thời khẩn hoang','','inherit','closed','closed','','31-revision-v1','','','2017-04-18 06:56:24','2017-04-18 06:56:24','',31,'http://demo-wordpress.dev/index.php/2017/04/18/31-revision-v1/',0,'revision','',0),
